//https://leetcode.com/problems/unique-number-of-occurrences
class Solution {
public:
    bool uniqueOccurrences(vector<int>& arr) {
        unordered_map<int, int> m;
        for(auto a: arr){
            m[a]++;
        }
        unordered_set<int> s;
        for(auto it: m){
            s.insert(it.second);
        }
        if(s.size() == m.size())
            return true;
        return false;
    }
};

